utils:
var filterParams = {
    comparator: function (a, b) {
        var valA = parseInt(a);
        var valB = parseInt(b);
        if (valA === valB)
            return 0;
        return valA > valB ? 1 : -1;
    }
};

function getRowData() {
    var rows = [];
    for (var i = 1; i < 117; i++) {
        rows.push({ age: i });
    }
    return rows;
}
